1) pay court costs;
2) pay supervision fees;
3) maintain absolute sobriety;
4) no contact with the victims or anyone under the age of 18 unless approved by the agent;
5) comply with Sex Offender Registry as directed by statute;
6) assessment, treatment, counseling as deemed appropriate by the Department's assessment process.
